description:
Where do consequences lead? Depends on the Escort. When a beautiful young woman enters the escorting profession, she's put off by her first client a handsome but cocky gentleman who's thirst for sex is supported by lots of cash. But under the tutelage of a smart and capable madam, she quickly learns the ropes of the world's oldest profession, and realizes that there is a little charm and romance under his macho exterior. Starring the stunning Lily Love, with Lola Foxx, Dana DeArmond and Presley Hart, Marcus London, Tyler Nixon and Seth Gamble.

